import React, { useEffect, useState } from 'react'
import { Form, InputGroup, Table } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import { Link } from 'react-router-dom';
import './App.css';

export default function CreateStudent() {
  const [id, setId] = useState('');
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [place, setPlace] = useState('');

  const handleSubmit=(e)=>{
    e.preventDefault();
    
  }
  return (
    <div className="container mt-4">
      <Card className="col-md-5 mx-auto shadow" style={{ width: "60%" }}>
        <Card.Body>
          <Card.Title className="text-center ">Create Student</Card.Title>
          <Form onSubmit={handleSubmit}>
            <Form.Group className="mb-3" controlId="exampleForm.ID">
              <Form.Label>Id </Form.Label>
              <Form.Control type="text" value={id} onChange={e=>setId(e.target.value)}/>
            </Form.Group>

            <Form.Group className="mb-3" controlId="exampleForm.Name">
              <Form.Label>Name </Form.Label>
              <Form.Control type="text" value={name} onChange={e=>setName(e.target.value)}/>
            </Form.Group>

            <Form.Group className="mb-3" controlId="exampleForm.Email">
              <Form.Label>Email address</Form.Label>
              <Form.Control type="email" placeholder="name@example.com" value={email} onChange={e=>setEmail(e.target.value)}/>
            </Form.Group>

            <Form.Group className="mb-3" controlId="exampleForm.Phone">
              <Form.Label>Phone </Form.Label>
              <Form.Control type="text" value={phone} onChange={e=>setPhone(e.target.value)}/>
            </Form.Group>

            <Form.Label>Place </Form.Label>
            <Form.Select aria-label="Default select example" controlId="exampleForm.Place" value={place} onChange={e=>setPlace(e.target.value)}>
              <option>Open this select menu</option>
              <option value="1">One</option>
              <option value="2">Two</option>
              <option value="3">Three</option>
            </Form.Select>
          </Form>

          <div className='d-flex mt-4 justify-content-center'>
          <button className="btn btn-primary me-2"> Save</button>
          <Link className='btn btn-danger' to="/"> Back</Link>
          </div>
         
        </Card.Body>
      </Card>
    </div>
  );
}
